import logo from './logo.svg';
import React, { useState } from 'react';
import './App.css';

class App extends React.Component() {
  render() {
    return (
      <div className='App'>
        <p>You are not signed in. Click here to sign in.</p>
        <button id='loginButton'>Login with Google</button>
      </div>
    );
  }
}

export default App;
